import{_ as a,o as t,c as e,e as r}from"./chunks/framework.nzJD8CNM.js";const o="/assets/IMG_0986.SiQ6xiM6.jpg",l="/assets/ToiODEBeKew.EkYTS_D5.jpg",i="/assets/u4zodAZEbMU.7Ojc6XIt.jpg",g=JSON.parse('{"title":"Кедр","description":"","frontmatter":{"title":"Кедр","date":"2015-07-30","icon":"logo.png","cover":"cover.jpg","vk":"stolarkadoma","address":"Самокатная ул. д 4, стр 27","place":"Кристалл","city":"г. Москва","coord":[55.7559965402663,37.673623883515575],"url":"https://kedrosad.ru","tel":"+7 (926) 410-38-91","status":"open"},"headers":[],"relativePath":"workshop/archive/kedr/index.md","filePath":"workshop/archive/kedr/index.md"}'),s={name:"workshop/archive/kedr/index.md"},n=r('<h4 id="общественная-мастерская" tabindex="-1">Общественная мастерская <a class="header-anchor" href="#общественная-мастерская" aria-label="Permalink to &quot;Общественная мастерская&quot;">​</a></h4><p>Общественная мастерская, т.е. столярный коворкинг - это  аренда рабочего места в мастерской, где Вы можете изготовить то, что Вам нужно. Например, мебель из дерева своими руками.</p><p>Ели Вы не умеете ничего, то можете пройти обучение столярному делу на наших столярных курсах для начинающих <a href="http://kedrosadmaster.ru/stoliarnay_shkola" title="Подробно о курсе Креативной столярки" class="external-link" target="_blank" rel="noreferrer">&quot;Креативная столярка для начинающих за 4 дня&quot;</a> , а затем закреплять навыки и изготавливать мебель из дерева своими руками для дома или дачи в нашей общественной мастерской в свободном режиме.</p><p>Для изготовления Вам понадобяться верстак, инструменты оборудование, и, возможно, дельный совет (консультация) мастера.</p><p>Наша общественная мастерская предлагает такую возможность всем желающим, у кого чешутся руки, глаза горят, а сердце просит творческой работы руками! Особенно мы рады видеть тех, кто прошел наши курсы, кого мы &quot;заразили&quot; столяркой! Ребята приходите! С нас всевозможные льготные условия для Вашего развития!</p><h4 id="инструменты-оборудование-материалы-и-фурнитура-общественнои-столярнои-мастерскои" tabindex="-1">Инструменты, оборудование, материалы и фурнитура общественной столярной мастерской <a class="header-anchor" href="#инструменты-оборудование-материалы-и-фурнитура-общественнои-столярнои-мастерскои" aria-label="Permalink to &quot;Инструменты, оборудование, материалы и фурнитура общественной столярной мастерской&quot;">​</a></h4><p>Мы постоянно расширяем техническую базу мастерской. Однако, что бы это происходило полезнее именно для Вас просим присылать заявки на те инструменты и оборудование, которые нужны именно Вам!</p><p>Так же мы всегда готовы рассмотреть вариант когда Вы покупаете то, что нужно самостоятельно, пользуетесь, а затем мы выкупаем у Вас это техническое средство!</p><p>С материалом и фурнитурой то же самое. Мы решили нет смыслы закупать все подряд. Ибо рынок очень велик. Лучше когда Вы заранее оставляете заявки на то что Вам нужно и мы решаем этот вопрос. И, конечно, Вы можете привозить свои материалы, фурнитуру и инструмент.</p><p>Оставить заявку можно в <a href="http://kedrosadmaster.ru/#feedback" class="external-link" target="_blank" rel="noreferrer">окошке обратной связи</a> или по телефону</p><h5 id="варианты-оплаты-на-работу-в-общественнои-столярнои-мастерскои" tabindex="-1">Варианты оплаты на работу в общественной столярной мастерской: <a class="header-anchor" href="#варианты-оплаты-на-работу-в-общественнои-столярнои-мастерскои" aria-label="Permalink to &quot;Варианты оплаты на работу в общественной столярной мастерской:&quot;">​</a></h5><ul><li><strong>Почасовая оплата аренды места в мастерской -</strong> 300 р/час (для прошедших курс Креативная столярка - )</li><li>Почасовая оплата аренды места в мастерской <strong>для прошедших наш столярный курс</strong> - 150 р/ч</li><li><strong>Абонемент на месяц &quot;Новый человек&quot;</strong> - 5000 р. - неограниченное посещение для тех, кого мы не знаем.</li><li><strong>Пакет &quot;30 часов&quot;</strong> - 6000 р. - покупка 30 часов работы в мастерской и использовании их в течение 6 месяцев.</li><li><strong>Абонемент на месяц &quot;Свои люди&quot; -</strong> 2500р. - неограниченное посещение для наших учеников, прошедших курс &quot;Креативная столярка для начинающих&quot;</li></ul><h5 id="что-входит-в-стоимость" tabindex="-1">Что входит в стоимость: <a class="header-anchor" href="#что-входит-в-стоимость" aria-label="Permalink to &quot;Что входит в стоимость:&quot;">​</a></h5><p>Аренда рабочего места в столярной мастерской, инструмент и оборудование, чай-кофе, консультация по проекту. Для прошедших курс Креативная столярка так же входит первичное  обучение новому оборудованию.</p><h5 id="что-оплачивается-отдельно" tabindex="-1">Что оплачивается отдельно: <a class="header-anchor" href="#что-оплачивается-отдельно" aria-label="Permalink to &quot;Что оплачивается отдельно:&quot;">​</a></h5><ul><li>Для тех, кого мы пока не знаем так же есть почасовое обучение.</li><li>Материалы, фурнитура - оплачиваются отдельно или привозите свое.</li><li>Обучение столярному делу в группах</li><li>Индивидуальное обучение</li></ul><p>Приходите к нам в нашу общественную мастерскую и реализуйте свои идеи вместе с нами!</p><p><img src="'+o+'" alt=""><img src="'+l+'" alt=""><img src="'+i+'" alt=""></p><h4 id="формат-прохождения-столярного-курса-для-начинающих" tabindex="-1">Формат прохождения столярного курса для начинающих <a class="header-anchor" href="#формат-прохождения-столярного-курса-для-начинающих" aria-label="Permalink to &quot;Формат прохождения столярного курса для начинающих&quot;">​</a></h4><p>Обучение проходит как по выходным дням, так и по будням. Индивидуаьные и групповые занятия.</p><ul><li><p>Групповые занятия. 4 выходных дня = 36 - 40ч = 16 000 рублей при заблаговременной оплате от 6 дней до начала. При оплате в последнюю неделю курса  =18 000 руб.</p></li><li><p>Обучение по будням вечером по свободному графику. То же столярный курс для начинающих для тех, кто не может заниматься по выходным. Смесь индивидуального обучения с самостоятельной работой по свободному графику по будням. Или же Вы начинаете обучение с группой, но заканчиваете в свободном режиме по будням.  36 - 40ч = 19500 руб.</p></li><li><p>Индивидуальное обучение.  36 - 40ч = 25000 руб. или 800р.</p></li></ul>',21),p=[n];function d(c,h,u,_,k,m){return t(),e("div",null,p)}const f=a(s,[["render",d]]);export{g as __pageData,f as default};
